  [],\n\t\"num_tags\": 0,\n\t\"name\": \"temperature-profile-and-other-data-collected-using-bottle-and-ctd-casts-from-the-parramatta-and\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Oceanographic Station Data, temperature,
  and other data were collected using CTD and bottle casts from PARRAMATTA and other
  platforms in a world-wide distribution from October 4, 1903 to December 19, 1963.
  Data were submitted by Australia Navy as part of the California Cooperative Fisheries
  Investigation (CALCOFI) project. Data were processed by NODC to the NODC standard
  Oceanographic Station Data (SD2) and the Universal Bathythermograph Output (UBT)
  formats. Full format descriptions are available at nodc.noaa.gov/.nnThe Oceanographic
  Station Data format contains physical-chemical oceanographic data recorded at discrete
  depth levels. Most of the observations were made using multi-bottle Nansen casts
  or other types of water samplers. A small amount (about 5 percent) were obtained
  using electronic CTD (conductivity-temperature-depth) or STD (salinity-temperature-depth)
  recorders. The CTD/STD data were reported to NODC at depth levels equivalent to
  Nansen cast data, however, and have been processed and stored the same as the Nansen
  data. Cruise information (e.g., ship, country, institution), position, date, and
  time, and reported for each station. The principal measured parameters and temperature
  and salinity , but dissolved oxygen, phosphate, total phosphorus, silicate, nitrate,
  nitrite, and pH may be reported. Meteorological conditions at the time of the cast
  (e.g., air temperature and pressure, wind, waves) may also be reported, as well
  as auxiliary data such as water color (Forel-Ule scale), water transparency (Secchi
  disk depth), and depth to bottom. Values of density (sigma-t) sound velocity, and
  dynamic depth anomaly are computed from measured parameters. Each station contains
  the measurements taken at the observed depth levels, but also includes data values
  interpolated to a set of standard depth levels.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
